import React from 'react';
import '../Styles/Projects.css';
import CNNup from '../assets/CNN-UpRight.png';
import CNNlaying from '../assets/CNN-LayDown.png';


// import React, { useState } from 'react'

function Projects(props, {projectTags}) {
    // const [projects, setProjects] = useState([
    //     { projectName: ''},
    // ]);

    console.log(projectTags)

//     const listItems = projectTags.map((number) =>
//     <li>{number}</li>
// );

    const projectTagsList = props.projectTags;
    const listItems = projectTagsList.map((tags) =>
        // <li  key={tags}>{tags}</li>
        <p className='tag-titles'key={tags}>{tags}</p>

    );


    return (
        <div className="frame">

            <div className="grid-container">
                <div className="grid-item">
                    {/* <div className="project-details"> */}
                    <div className="information-side">
                        <p className="title-of-project">{props.projectTitle}</p>
                        {/* <p className="title-of-project">Convolutional<br></br>Neural<br></br>Network</p> */}
                        <p className="project-from">{props.projectFrom}</p>
                        <p className="project-info">{props.projectInfo}</p>
                        <p className="project-link">View Paper</p>
                    </div>

                    <div className="project-tags">
                        <p className='title'>Built With:</p>
                        <div>{listItems}</div>
                    </div>
                    {/* </div> */}
                </div>
                <div className="grid-item">
                    {/* <div className="project-images"> */}
                    <img className="image-project-one" src={CNNup} alt="gitHub" width="500em" height="700em"></img>
                    <img className="image-project-two" src={CNNlaying} alt="gitHub" width="600em" height="400em"></img>
                    {/* </div> */}
                </div>
            </div>
            <div className="project-tags">    
            </div>
        </div>
    )
}

export default Projects
